import React from "react";
import Template from "../components/Template";

export default function ResumeTemplate() {
  return (
    <Template>
      {/* 전체 배경 */}
      <main className="min-h-screen bg-white flex flex-col items-center font-[Pretendard]">
        {/* 제목 (Frame 119) */}
        <section className="text-center mt-24 mb-12">
          <h1 className="text-[64px] font-semibold tracking-tight leading-[140%] text-black">
            Hirely가 제공하는 이력서 양식
          </h1>
        </section>

        {/* 템플릿 박스 (Frame 164) */}
        <section className="w-[1165px] bg-[#F7F7FB] shadow-[0_4px_16px_0_#76767633] rounded-[16px] p-10 flex flex-col items-center gap-8">
          {/* 다운로드 버튼 (Frame 117) */}
          <button className="self-end bg-[#5F43FF] text-white font-medium text-[20px] px-6 py-2 rounded-md hover:bg-[#6E54FF] transition">
            다운로드
          </button>

          {/* 템플릿 헤더 (Frame 131~129) */}
          <div className="flex flex-col items-start w-full mb-6">
            <h2 className="text-[32px] font-normal leading-[140%] tracking-tight text-black">
              Template C
            </h2>
          </div>

          {/* 이력서 이미지 설명 텍스트 */}
          <p className="text-[20px] font-medium text-black mb-4 self-start">
            이력서 이미지
          </p>

          {/* 실제 템플릿 이미지 자리 (Rectangle 10) */}
          <div className="w-full h-[500px] bg-[#D9D9D9] rounded-md flex items-center justify-center text-gray-500">
            이미지 미리보기 영역
          </div>
        </section>

        {/* 다른 템플릿 섹션 (Frame 163, Frame 132) */}
        <section className="flex flex-row justify-center gap-16 mt-20 mb-24">
          {/* Frame 163 */}
          <div className="w-[500px] h-[300px] bg-[#F7F7FB] shadow-[0_4px_16px_0_#76767633] rounded-[12px] flex flex-col items-center justify-center">
            <h3 className="text-[32px] font-semibold text-black mb-2">Template A</h3>
            <p className="text-gray-600">간결한 레이아웃의 기본형</p>
          </div>

          {/* Frame 132 */}
          <div className="w-[500px] h-[300px] bg-[#F7F7FB] shadow-[0_4px_16px_0_#76767633] rounded-[12px] flex flex-col items-center justify-center">
            <h3 className="text-[32px] font-semibold text-black mb-2">Template B</h3>
            <p className="text-gray-600">디자인 강조형 이력서</p>
          </div>
        </section>
      </main>
    </Template>
  );
}
